def decalage(texte,decalage):
    texteSortie = ""
    for a in texte:

        valnum = ord(a)
        if (65 <= valnum < 91):
            var = ((valnum - 65) + decalage) % 26 + 65
            char = chr(var)
        elif (97 <= valnum < 123):
            var = ((valnum - 97) + decalage) % 26 + 97
            char = chr(var)
        else:
            char = a
        texteSortie += char
    return texteSortie


